  [],\n\t\"revision_timestamp\": \"2015-05-07T03:47:11.921938\",\n\t\"name\": \"mems-based-solutions-for-an-integrated-and-miniaturized-multi-spectrum-energy-harvesting-a\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The objective of this proposal is to integrate
  three unique energy harvesting technologies utilizing our existing research strengths
  that will be of interest and utility to NASA applications and environmental conditions.
  By developing multiple technologies, NASA will be able to harvest energy from multiple
  waste energy sources, namely environmental vibrations, thermal energy, and solar
  flux. These devices were initially developed and demonstrated separately, but will
  be enhanced, matured, and integrated during Phase II. The prototype resulting from
  this effort will be capable of harvesting energy in a variety of environments which
  support NASA's broad mission.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
